import './App.css';
import React from 'react';

class NavHeader extends React.Component {
  state = {
    display: "inline-flex",
    width: "100%",
    height: "fit-content",
    color: "white",
    "background-color": "black"
  }

  content_state = {
    margin: "20px"
  }

  render(){
    return (
      <nav style={this.state}>
        <h1 style={this.content_state}>Vibe Chat</h1>
        <h2>:</h2>
        <input type='button' onClick={this.setState("background-color: orange")} value="Press"/>
      </nav>
    );
  }
}


function App() {
  return (
    <NavHeader />
  );
}

export default App;
